import react from 'react';
import './Posts.css';

export default function Posts() {
    return (
        <div className="posts-wrapper">
            <div className="post">
                <h3>Post 1</h3>
                <p>This is the first post</p>
            </div>
            <div className="post">
                <h3>Post 2</h3>
                <p>This is the second post</p>
            </div>
            <div className="post">
                <h3>Post 3</h3>
                <p>This is the third post</p>
            </div>

        </div>
    )
}
